import React from 'react';
import './App.css';
import Footer from './categories/footer/Footer';
import Header from './categories/header/Header';
import Main from './categories/main/Main';

function App() {
  return (
    <div className="App">
      <Header />
      <Main />
      <Footer />
    </div>
  );
}

export default App;
